import Home from "./Home";
import Registration from "./Registration";
import Login from "./Login";
import HostelBook from "./HostelBook";
import ViewAll from "./ViewAll";
import "./App.css";

const App = () => {
  return ( 
    <>
    <Router>
      <div className="header">
       <span className="Link2"><Link to="/">Home</Link></span> 
       <span className="Link1"><Link to="/register">Registration</Link></span> 
       <span className="Link1"> <Link to="/login">Login</Link></span> 
       <span className="Link1"> <Link to="/bookho">Book Hostel</Link></span> 
       <span className="Link1"><Link to="/">All Student</Link></span> 
      </div>
      <Switch>
        <Route exact path="/">
          <Home />
        </Route>
      </Switch>
    </Router>
    </>
   );
}

export default App;
